text:
there are quite a few sexual assaults i have endured in this life, a lot because i was a child of sexual assault by disgusting men who prayed on me being a helpless child, as i grew up it continued and unfortunately it was something i was so used it i thought it was normal, when i was really raped the first time as a teenager (and by that me knowing it was wrong and me saying no and being forced) i never told anyone but a friend or 2, my father was asleep in the house when it took placed i was so scared and confused,  i was kidnapped before this encounter when i was 13 he took me to his home where his parent also lived i believe he was a adult and he had me for about 2 days if i remember correctly, it was by far a crazy and traumatic experience when i got back i did have to go have a tape kit and all that done and as a end result he only served 9 months in jail for 2 counts of indecent liberty with a minor, what bullshit.. him including other men who have sexually assaulted me have tried contacting me after these events took place trying to control me, but i stand in my power i push through what some would say i should be, i'm no victim i'm a survivor, i'm a silence breaker, i take no shit, i let no one have power or control over me. i heal each and every day so i have be the best version of myself and a example for others, i hope us women can stand strong thru this hard difficult time out country is facing.. i'm tagging 3 women who have used there voice and there power to spread awareness, thank you there are many more i could but you inspire me.
@sophiabush
@milano_alyssa
@ashley_judd
#speechless #metoo #timesup #survivor #victom #whyididntreport 
#rapevictim #rapeculture #rapesurvivor #sexualassult #truama

