text:
regardless of today's devastating vote, let us please take a moment to recognize the heroism displayed by dr. christine blasey ford. in doing what she considered her civic duty, she came forward with her story of how she survived brett kavanaugh's attack. she did it in an attempt to save us from a sexual predator being on the supreme court. republicans (and joe manchin) ignored her. however, dr. ford did succeed in saving millions of women from  the fear and anguish that being a survivor of sexual abuse can bring. dr. ford showed them, by her bravery, that they too needn't be afraid of telling their stories and regaining their voices. in doing this for all survivors, i believe she truly rescued her teenage self from her own angush. i pray that dr. ford knows what she did for so many, and i hope her brave confrontation of her abuser gives her peace. 
#thankyoudrchristineblaseyford #ibelieveher #ibelievesurvivors #brettkavanaugh #scotus #ibelievechristineblaseyford #drblaseyford #istillbelieveanitahill #anitahill #metoo #timesup #vote #resist #roevwade #saveroe #novemberiscoming  #christineblaseyford #feminist

@regran_ed from @bklyngirl1770  #regrann

